import React from 'react';
import { ThemeProvider } from '@mui/material/styles';
import { CssBaseline, Box } from '@mui/material';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import theme from './theme';
import Sidebar from './components/layout/Sidebar';
import LinkedInInput from './components/candidates/LinkedInInput';
import BatchUpload from './components/candidates/BatchUpload';
import ManualInput from './components/candidates/ManualInput';
import CandidatesPage from './pages/CandidatesPage';

const App = () => {
  return (
    <ThemeProvider theme={theme}>
      <Box sx={{
        minHeight: '100vh',
        bgcolor: 'background.default'
      }}>
        <Sidebar />
        <Box
          component="main"
          sx={{
            flexGrow: 1,
            p: 3,
            marginLeft: '280px',
            minHeight: '100vh'
          }}
        >
          <Routes>
            <Route path="/" element={<Navigate to="/linkedin" replace />} />
            <Route path="/linkedin" element={<LinkedInInput />} />
            <Route path="/batch" element={<BatchUpload />} />
            <Route path="/manual" element={<ManualInput />} />
            <Route path="/candidates" element={<CandidatesPage />} />
          </Routes>
        </Box>
      </Box>
    </ThemeProvider>
  );
};

export default App;
